Е150d - Сахарный колер IV. Пищевая добавка E150d входит в группу добавок E150 (сахарный колер). Это краситель, устойчивый к повышенной кислотности продукта, воздействию света, перепадам температуры. Он подходит для продуктов, которые в процессе обработки и приготовления подвергаются высокой температуре и давлению, имеют высокую кислотность. Добавка E150d хорошо растворяется в воде, имеет высокую микробиологическую стабильность. Благодаря ей в готовом продукте не образуются вредные микроорганизмы. 

Пищевой краситель E150d помогает устранить образование осадка в продуктах – за это отвечает свойство его молекул иметь положительный или отрицательный остаточный заряд (зависит от реагентов, используемых при производстве).

Как и все виды добавок группы E150, краситель E150d производят при помощи термической обработки углеводов – глюкозы, сахарозы. Главное отличие от других добавок Е150 – в процессе производства в смесь для реакции добавляются аммонийные и сульфитные соединения (щелочи и кислоты). Так при производстве добавки Е150d могут использоваться: фосфат аммония, гидроксид аммония, серная кислота, сульфат аммония, сульфит и бисульфит аммония, сульфит и бисульфит натрия, сульфит и бисульфит калия, карбонат и гидрокарбонат аммония.

Основные характеристики добавки E150d:

Цвет – темно-коричневый, почти черный (самый темный в группе);
Запах – жженый сахар;
Консистенция – порошок или раствор;
Вкус – горький.
Пищевая добавка E150d является самой опасной в классе E150. Согласно некоторым исследованиям, она имеет слабое канцерогенное действие, может вызывать онкологические заболевания и проблемы с желудочно-кишечным трактом. В то же время, согласно данным экспертного комитета ФАО/ВОЗ, краситель будет считаться безопасным для организма, если не превышается его максимальная суточная доза – 200 мг на 1 кг веса тела.

Мак пищевой — один из самых популярных ингредиентов для выпечки и кондитерских изделий, который придаёт им тонкий пряный вкус.

Главные характеристики такого продукта:

высокая степень очистки зёрен — 99,9%;

однородность и отсутствие посторонних примесей;

влажность, соответствующая допустимым показателям — не более 7%.

Мак используется для изготовления кондитерских и хлебобулочных изделий. Его применяют как основу для начинки пирогов, рулетов, рогаликов, плюшек, добавляют при замешивании в тесто, а также используют в качестве элемента декорирования.
